import React from 'react';

const numberWidget = (props) => {
  return (
    <div>
      <col>
        <div className="row text-success my-4">
          <div className="col-4">
            <h5 className="text-muted">{props.title}</h5>
            <h1 className="display-4">{props.value}</h1>
          </div>
        </div>
      </col>
    </div>
  );
};

export default numberWidget;
